import React from 'react';
import {
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableRow,
  Typography,
  Paper
} from '@mui/material';

const InternshipDetailsTable = () => {
  const data = {
    rollNo: 'MHM2023012',
    completionMonthYear: 'June 2025',
    internshipFrom: '01/01/2025',
    internshipTo: '31/03/2025',
  };

  return (
    <Box
      sx={{
        border: '1px solid #ccc',
        borderRadius: 2,
        p: 2,
        mt: 3,
        backgroundColor: '#f9f9f9',
        boxShadow: '0px 2px 5px rgba(0,0,0,0.1)',
      }}
    >
      <Typography variant="h6" gutterBottom>
        Internship Details
      </Typography>

      <TableContainer component={Paper} elevation={0}>
        <Table size="small">
          <TableBody>
            <TableRow>
              <TableCell><strong>Roll No</strong></TableCell>
              <TableCell>{data.rollNo}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell><strong>Completion (Month/Year)</strong></TableCell>
              <TableCell>{data.completionMonthYear}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell><strong>Internship From</strong></TableCell>
              <TableCell>{data.internshipFrom}</TableCell>
            </TableRow>
            <TableRow>
              <TableCell><strong>Internship To</strong></TableCell>
              <TableCell>{data.internshipTo}</TableCell>
            </TableRow>
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default Internship;
